// Function to select a random set of images and links
  function getRandomImages(numImages) {
    let selectedImages = [];
    let usedIndices = new Set(); // To avoid duplicates

    while (selectedImages.length < numImages) {
      const randomIndex = Math.floor(Math.random() * imageList.length);
      if (!usedIndices.has(randomIndex)) {
        selectedImages.push(imageList[randomIndex]);
        usedIndices.add(randomIndex);
      }
    }
    return selectedImages;
  }

// Function to display the random images and links
  function showRandomImages() {
    const randomImages = getRandomImages(5); // Select 5 random images

 // Assign images and links to the anchor elements
    for (let i = 0; i < randomImages.length; i++) {
      const imageElement = document.getElementById(`image${i + 1}`);
      imageElement.style.backgroundImage = `url(${randomImages[i].url})`;
      imageElement.href = randomImages[i].link; // Set the link
    }
  }

  // Call the function when the page loads
  window.onload = showRandomImages;